import React from 'react';
import logo from './logo.svg';
import './App.css';
import Button from '@material-ui/core/Button';


function App() {
  return (
    <div className="App">
      <header>

      </header>
      <Button variant="contained" color="primary">
      Hello World
    </Button>
    <p class="codepen" data-height="228" data-theme-id="0" data-default-tab="html,result" data-user="stw" data-slug-hash="KEoLaV" style="height: 228px; box-sizing: border-box; display: flex; align-items: center; justify-content: center; border: 2px solid; margin: 1em 0; padding: 1em;" data-pen-title="KEoLaV">
  <span>See the Pen <a href="https://codepen.io/stw/pen/KEoLaV/">
  KEoLaV</a> by Stu (<a href="https://codepen.io/stw">@stw</a>)
  on <a href="https://codepen.io">CodePen</a>.</span>
</p>
<script async src="https://static.codepen.io/assets/embed/ei.js"></script>
    </div>
  );
}

export default App;
